#Declaring parameter variables

N = Real('N')
s.add(N >= 0)
T = Real('T')
s.add(T >= 0)
F = Real('F')
s.add(F >= 0)
MAJ = Real('MAJ')
s.add(MAJ >= 0)

#Adding the resilience condition

s.add(N > 2)
s.add(F >= 0)
s.add(T >= 1)
s.add(N > (2 * T))
s.add(F <= T)
s.add(Or(((MAJ - 1) * 2) == (N - 1), ((MAJ - 1) * 2) == N))
s.add(MAJ == (N - T))
s.add(F == 0)

